import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class CoinList extends Component {
    render() {
        return (
            <div>
                <h3>Coins List</h3>
                <table className="table table-striped" style={{ marginTop: 20 }} >
                    <thead>
                        <tr>
                            <th>Currency</th>
                            <th>Date</th>
                            <th>Open</th>
                            <th>High</th>
                            <th>Low</th>
                            <th>Close</th>
                            <th>Volume</th>
                            <th>MarketCap</th>
                        </tr>
                    </thead>
                    <tbody>
                        { this.coinList() }
                    </tbody>
                </table>
            </div>
        )
    }
}
